    font-size: 54px; 
    text-align: center;
    text-transform: uppercase;
    font-weight: 600;
    width: fit-content;
    opacity: 0;

    &:nth-of-type(1) {
        font-size: 40px;
    }

    &:nth-of-type(2) {
        font-size: 80px;
    }
}

    // Mobile
    @media only screen 
    and (max-width: 450px) {
        .ending-section {
            display: grid;
            place-items: center;
            width: 100%;
            height: 50vh;
        }

